import Logo from "./logo.png";
import "./App.css";
import styled from "styled-components";
import { ObjectDetector } from "./components/objectDetector";

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  // background-color: #1d2475;
  background-color: #3f3d42;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  color: #fff;
`;

function App() {
  return (
    <AppContainer>
      <img src={Logo} style={{width:150,marginBottom:30}}/>
      <div style={{marginBottom:30,}}> 텐서플로우를 활용한 객체인식</div>
      <ObjectDetector />
      <ObjectDetector />
    </AppContainer>
  );
}

export default App;
